import React from 'react';
import ReactDOM from 'react-dom/client';  // Using React 18's new root API
import './index.css'; // If you have a global CSS file, include it here
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom'; // For routing

// Creating the root of the React app
const root = ReactDOM.createRoot(document.getElementById('root'));

// Rendering the app and wrapping it with Router
